I met Rhyanna at a liquor store a few weeks ago and she gave me a call letting me know she wanted me to meet a friend. Becky was a fellow mom who she met at the same day care her son goes to. They had hit it off right away and got real friendly with each other ever since they realized they were both single moms going through baby daddy problems. She told Becky about me and how much fun she had being naughty with me. She convinced Becky to go out with her, my buddy Ash (as always) and me. They showed up just before sunset and we partied way before we even had a night out on the town. This was one freaky threesome. Both mommies had legs that just would not quit! Two tall and petite freaks between the sheets.
